import React, {useEffect, useState} from 'react'
import useForm from 'react-hook-form'
import {InMemoryCache} from "apollo-cache-inmemory";
import {HttpLink} from "apollo-link-http";
import {ApolloClient} from "apollo-client";
import gql from "graphql-tag";
import Select from "react-select";

const InputForm = initialState =>  {
    const { register, handleSubmit } = useForm()
    const onSubmit = data => console.log(data)
    const [dropdowndata, setDropDownData] = useState();
    const [selected, setselected] = useState();


    const cache = new InMemoryCache();
    const link = new HttpLink({
        uri: 'http://localhost:8080/v1/graphql'
    });

    const client = new ApolloClient({
        cache,
        link
    });

    useEffect(() => {
        try {
            client
                .query({
                    query: gql`
 {
  positivitydbschema_skill {
    name
  }
}
    `
                })
                .then(result => result.data.positivitydbschema_skill.map(skills => {
                    arrayni.push(`{label: ${skills.name}}`)
                    console.log(arrayni)
                }))


        } catch (e) {
            console.log(e)

        }
    })


    const lista = [
        { value: 'ocean', label: 'Ocean', color: '#00B8D9', isFixed: true },
        { value: 'blue', label: 'Blue', color: '#0052CC', isDisabled: true },
        { value: 'purple', label: 'Purple', color: '#5243AA' },
        { value: 'red', label: 'Red', color: '#FF5630', isFixed: true },
        { value: 'orange', label: 'Orange', color: '#FF8B00' },
        { value: 'yellow', label: 'Yellow', color: '#FFC400' },
        { value: 'green', label: 'Green', color: '#36B37E' },
        { value: 'forest', label: 'Forest', color: '#00875A' },
        { value: 'slate', label: 'Slate', color: '#253858' },
        { value: 'silver', label: 'Silver', color: '#666666' },
    ];
    var arrayni = []


    return (
        <form onSubmit={handleSubmit(onSubmit)}>
            <input name="firstName" ref={register({ required: true, maxlength: 20 })} />
            <input name="lastName" ref={register({ pattern: /^[A-Za-z]+$/i })} />
            <Select options={lista} onChange={console.log("jee")}/>
            <input name="age" type="number" ref={register({ min: 0, max: 100 })} />
            <input type="submit" />
        </form>
    );
}

export default InputForm
